6.- Le n° 59.07  ne comprend pas  : 

a) les tissus dont l'imprégnation, l'enduction ou le recouvrement ne sont pas perceptibles à  
l'oeil nu (Chapitres 50 à 55, 58 ou 60 généralement); il est fait abstraction, pour l'application  
de cette disposition, des  changements  de couleur  provoqués  par ces opérations;  

b) les tissus peints (autres que les toiles peintes pour décors de théâtres, fonds d'ateliers ou  
usages  analogues);  

c) les tissus  partiellement  recouverts  de tontisses,  de poudre  de liège  ou de produits  
analogues, qui présentent des dessins provenant de ces traitements; toutefois, les imita - 
tions  de velours  restent  classées  dans  la présente  position;  

d) les tissus ayant subi les apprêts normaux de finissage à base de matières amylacées ou de  
matières  analogues;  

e) les feuilles  de placage  appliquées  sur un support  en tissu  (n° 44.08);  

f) les abrasifs  naturels  ou artificiels  en poudre  ou en grains  appliqués  sur support  en tissu 
(n° 68.05);  

g) le mica  aggloméré  ou reconstitué  sur support  en tissu (n° 68.14);  

h) les feuilles et bandes minces en métal fixées sur support en tissu (généralement Sections  
XIV ou XV). 
