- les cordons lubrifiants et les tresses, cordes et produits textiles similaires de bourrage  
industriel,  même  imprégnés,  enduits  ou armés  ; 

b) les articles textiles à usages techniques (autres que ceux des n°s 59.08 à 59.10) (tissus et  
feutres sans fin ou munis de moyens de jonction, des types utilisés sur les machines à  
papier ou sur des machines similaires (à pâte, à amiante -ciment, par exemple), disques à  
polir, joints,  rondelles  et autres  parties  de machines  ou d'appareils,  par exemple).  
